def candidates = _.geom.spatialIndexQuery(geometry: _source.p.position.first())

//mit geom.find findet man Geometrie. Mit .geometry bekommt man jts
//Geometrie des Bauteils auslesen
def baugeom = (_.geom.find(_source.p.position.first())).geometry

//Liste von allen Gebäuden erzeugen, die mit der Bauteil-Geometrie in irgendeiner Beziehung stehen
def gebaeude = candidates.findAll{
//Geometrie jedes potentiellen Gebäudes auslesen
	it.definition.getDisplayName() == 'AX_Gebaeude'
}

//Fehlermeldung, falls ein Bauteil vorkommt, für das die Liste der potentiellen Gebäude leer bleibt
if (gebaeude.size()==0){
	_log.warn("Für das Bauteil mit der folgenden id konnte kein zugehöriges Gebäude identifiziert werden: " + _source.p.id.value())
}

def geb_id
def area
def intersection
def gebgeom
 
gebaeude.each { geb ->
	gebgeom = (_.geom.find(geb.p.position.first())).geometry
	//für jedes potentielle Gebäude prüfen, ob das Bauteil innerhalb des Gebäudes liegt --> Zuordnung
	if (baugeom.coveredBy(gebgeom)){
		geb_id = geb.p.id.value()
	}
	//für lageZurErdoberfläche = 1200 (unter der Erdoberfläche) prüfen, mit welchem das Gebäude das Bauteil die größte gemeinsame Überschneidungsfläche hat --> dieses
	//Gebäude wird ausgewählt
	if (_source.p.lageZurErdoberflaeche.value() == '1200'){
		if(baugeom.intersects(gebgeom)){
			intersection = gebgeom.intersection(baugeom).getArea()
			if (intersection>area){
				area = intersection
				geb_id = geb.p.id.value()
			}
		}
	}
}	

//in einem Kollektor wird über die Gebäude-ID als Schlüssel gespeichert, welche Bauteile diesem zugehören und welche Bauarten diese Bauteile haben. Bei der späteren Erzeugung der Gebäude wird
//auf diese Informationen zugegriffen
def c = _.context.collector()
_log.info('in den Kollektor gehen ' + _source.p.id.value() + ' und ' + _source.p.bauart.value())
c.bauid[geb_id] << _source.p.id.value()
c.bauart[geb_id] << _source.p.bauart.value()

_target{}

//bauwerksfunktion = '2030' or bauwerksfunktion = '2050' or bauwerksfunktion = '2060' or bauwerksfunktion = '2070' or bauwerksfunktion = '2080' or bauwerksfunktion = '2090'

def poigeom = _.geom.findPoints(_source.p.position.first())
def lingeom = _.geom.findLines(_source.p.position.first())
def polgeom = _.geom.findPolygons(_source.p.position.first())
def baufun = _source.p.bauwerksfunktion.value()
def targeom

//wenn die Quellgeometrie ein Polygon ist, wird diese übernommen
if (polgeom){
	targeom = polgeom
}

//wenn die Quellgeometrie ein Punkt ist, werden Standardwerte für den Durchmesser des Objektes verwendet
else if (poigeom){
	switch ( baufun ) {
	    case ['2050', '2060', '2070', '2080', '2090']:
	        targeom = _.geom.buffer(geometry: poigeom, distance: 5)
	    break
	    case ['2030']:
	    	_log.error('Es wurde eine Punktgeometrie gefunden, für die es keinen Standarddurchmesser gibt. Bauwerk-id: ' +  _source.p.id.value())
	}
}

//wenn die Quellgeometrie eine Linie ist, werden Standardwerte für die Breite des Objektes verwendet
else if (lingeom){
	switch ( baufun ) {
	    case ['2030', '2070', '2080']:
	        targeom = _.geom.buffer(geometry: poigeom, distance: 8)
	        break
	    case ['2050', '2060', '2090']:
	        targeom = _.geom.buffer(geometry: poigeom, distance: 5)
	}
}

else{
	_log.error("Dieses Objekt hat keine Geometrie: " + _source.p.id.value())
}

_target{
	geometry2D {
