				nilReason( 'other:unpopulated' )
				uom( 'm' )
			}
			horizontalGeometryReference {
				href( 'http://inspire.ec.europa.eu/codelist/HorizontalGeometryReferenceValue/footPrint' )
			}
			referenceGeometry( true )
		}
	}
}

