				uom( 'm' )
			}
			//für Befliegungsgebäude und aufgeständerte Gebäude können die Werte der horizontalGeometryReference je nach Datensatz unterschiedlich sein. Daher wird der Wert in diesen Fälllen über
			//eine Projektvariable übergeben und an dieser Stelle verwendet
			horizontalGeometryReference {
