					href( 'http://inspire.ec.europa.eu/codelist/HorizontalGeometryReferenceValue/' + _project.vars.HORIZONTALGEOMETRYREFERENCEVALUE_BEFLIEGUNGSGEBAEUDE )
				}
				else if (_source.p.lageZurErdoberflaeche.value() == '1400'){
					href( 'http://inspire.ec.europa.eu/codelist/HorizontalGeometryReferenceValue/' + _project.vars.HORIZONTALGEOMETRYREFERENCEVALUE_AUFGESTAENDERT )
				}
				//für Gebäude, deren Bauteile bestimmte Bauarten haben, muss der Wert combined gesetzt werden
				else if ( bauarten.contains('1100') || bauarten.contains('1200') || bauarten.contains('1300') || bauarten.contains('1400') || bauarten.contains('2500') || bauarten.contains('2510') || bauarten.contains('2520') || bauarten.contains('2720')){
					href( 'http://inspire.ec.europa.eu/codelist/HorizontalGeometryReferenceValue/combined')
				}
				else {
					href( 'http://inspire.ec.europa.eu/codelist/HorizontalGeometryReferenceValue/footPrint')
				}
			}
			referenceGeometry( true )
		}
	}
	//für jedes zu dem Gebäude gehöriges Bauteil wird ein part erzeugt
	bauteile.each{ part ->
		parts {
			href( '#BuildingPart_'+ part )
		}
	}
