def poigeom = _.geom.findPoints(_source.p.position.first())
def lingeom = _.geom.findLines(_source.p.position.first())
def polgeom = _.geom.findPolygons(_source.p.position.first())
def baufun = _source.p.bauwerksfunktion.value()
def targeom

//wenn die Quellgeometrie ein Polygon ist, wird diese übernommen
if (polgeom){
	targeom = polgeom
}

//wenn die Quellgeometrie ein Punkt ist, werden Standardwerte für den Durchmesser des Objektes verwendet
else if (poigeom){
	switch ( baufun ) {
	    case ['1001', '1005']:
	        targeom = _.geom.buffer(geometry: poigeom, distance: 15)
	        break
	    case ['1002', '1003', '1004', '1006', '1007', '9999']:
	        targeom = _.geom.buffer(geometry: poigeom, distance: 5)
	        break
	    case ['1008', '1009']:
	        targeom = _.geom.buffer(geometry: poigeom, distance: 10)
	        break
	    case ['1010', '1011', '1012', '9998']:
	    	_log.error("Es liegt eine Punktgeometrie vor, für die kein Standarddurchmesser angegeben ist. Bauwerk-id: " +  _source.p.id.value())
	}
}

//wenn die Quellgeometrie eine Linie ist, wird eine Fehlermeldung ausgegeben, da keine Standardwerte für die Breite angegeben sind.
else if (lingeom){
	_log.error("Es liegt eine Liniengeometrie vor, für die keine Standardbreite angegeben ist. Bauwerk-id: " +  _source.p.id.value()) 
}

else{
	_log.error("Dieses Objekt hat keine Geometrie: " + _source.p.id.value())
}

_target{
	geometry2D {
		BuildingGeometry2D {
			geometry { 
				MultiSurface(_.geom.toSimpleGeometries(geometries:targeom, collections:true))
			}
			horizontalGeometryEstimatedAccuracy() {
				nilReason( 'other:unpopulated' )
				uom( 'm' )
			}
			horizontalGeometryReference {
				href( 'http://inspire.ec.europa.eu/codelist/HorizontalGeometryReferenceValue/footPrint' )
			}
			referenceGeometry( true )
		}
	}
}

